import React from 'react'
import { useSelector } from 'react-redux'

const Users = () => {
  const users = useSelector(store => store.user)
  console.log(users)

  const showUsers = () => {
    if (users.length === 0) {
      return <div/>
    } else {
      users.map((user) => {
        <div key={user.id}>
          {user.name}
        </div>
      })
    }

  }
  return(
    <div>
      {showUsers}
    </div>
  )
}

export default Users
